CREATE TABLE explorer (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255)
);

CREATE TABLE journal_log_entry (
    id SERIAL PRIMARY KEY,
    entry_date TIMESTAMP,
    content TEXT,
    explorer_id INT REFERENCES explorer(id)
);

CREATE TABLE skill_assessment (
    id SERIAL PRIMARY KEY,
    explorer_id INT REFERENCES explorer(id),
    task_name VARCHAR(255),
    score INT
);



